const List = ({data}) => {
    const getList = list => list.map(item => <li key={item.videoId}>{item.videoId}</li>)
    return(
        <div>
            <ol> {getList(data) } 
            </ol>
        </div>
    )
}

const Video = ({data}) => {
    return(
        <div>
            <h1>{data[0].videoPrimaryInfoRenderer.title.runs[0].text}</h1>
            <h2>VideoId</h2>
        </div>
    )
}
export { List, Video };
